  return (
    <div className="New">
      <Header
        headText={"새 일기쓰기"}
        leftChild={
          <Link to="/">
            <Button text={"< 뒤로가기"} type={"default"} />
          </Link>
        }
      />
      <section>
        <h4>오늘은 언제인가요?</h4>
        <input type="date" />
      </section>
    </div>
  );
}
